import React from "react";
import "./homePage.css";
import Header from "../components/header";

function HomePage() {
    return (
        <div id="home-page">
            <Header />
            <div id="home-page-content">
                <img src="/test.jpeg" alt="" style="width= 30px"/>
            </div>
        </div>
    );
}

export default HomePage;
